snippet.textDisplay:
ফুল ফুটেছে, গন্ধে সারা মন; 
কিন্তু আজ এই গানের স্রষ্টা হাশেম মাহমুদের মন ভালো নেই। গানের সাথে হাশেম মাহমুদের দূরত্ব অনেক বেড়েছে। অভিমানে যেন এখন কথাই বলতে চায় না কারো সাথে। 
হাজার বছর বেঁচে থাকুক এই গুণী শিল্পী। ❤

